华工食品学院魏东教授&ldquo;藻赢天下&rdquo;创新业团队招聘启示

本团队将致力于藻类大健康产品研发和销售：
微藻膳食补充剂
微藻营养代餐食品
微藻三餐主食
微藻休闲方便食品
微藻生鲜果蔬肉蛋产品
微藻宠物粮
观赏动物微藻饲料
微藻肥料
微藻日化用品&hellip;
&nbsp;
线上销售（线上商城）为主，线下渠道为辅；物联网技术为消费者跟踪服务

作为初创公司，我们需要各类精英建立精干团队，要求综合能力强、以一当十：
&nbsp;
设计部：总监1名、成员1-2名
主要岗位：食品配方/包装设计、摄影、文案、美工&hellip;
&nbsp;
营销部：总监1名，组员2-3名
主要岗位：微信服务号运营、线上商城运营、促销、在线客服、售后、仓储物流&hellip;
&nbsp;
市场部：总监1名，组员2-3名
主要岗位：市场调研与策划、市场拓展、广告企化（文案、美工）&hellip;
&nbsp;
所有岗位对学生开放兼职，相信一定有适合你的岗位！
报名微信: wd18620675410

今天广州草莓音乐节终于出阵容了，阵容很强大，2016年元旦跨年最后一嗨！
我们可以一起看痛仰、万青、后海、新裤子&hellip;
十三、陈粒、陈鸿宇&hellip;
低苦艾、万晓利、海龟先生&hellip;
讲者、龙胆紫、满舒克&hellip;
本土的七镜、玩具船长&hellip;
还有嘻哈，电音一起嗨&hellip;
组队啦组队啦，一起去！

灯神啊灯神，有一个女生，我注意她很久了，她是在中区饭堂做勤工俭学的女生（今天也就是十二月十五日的晚上，她穿白色鞋子，黑色裤子，藏青色外套，长头发）
每次去中区饭堂吃饭，总是期待着能见到她，可是自己却没有勇气去对她说一句：能否做个朋友？唉╯▂╰
如若有缘，望相识&hellip;&hellip;

其实也不是来找人，只是想送一句祝福~
最近在图书馆复习经常会看到一位考研的师姐，注意到她说起来还是因为很像高中的一名同学(真的不是套路)，她总是在那一层学到闭馆，之后还会去二楼继续学习，今天本来没有看到她，后来离开的时候又看到她从三楼来到二楼&hellip;
没有想找到她，只是想祝福师姐能在接下来的考研中一切顺利，考出好成绩~

组队跨年咯，第一次元旦之前考完！大三了，还没尝试过出去跨年、珠江夜游、参观小蛮腰什么的，求一个司机带队，最好有个计划吧（倾向归宿），本人安全靠谱也有颜，带出去不丢人，可以帮你拍照，vivo柔光自拍，照亮你的美！
ps：我家妹子说让我找个妹子一起可能更有感觉，但是我内心虽然是愿意的嘴巴上还不能说要，所以男女都可以咯&psi;(｀&nabla;&acute;)&psi;
送你一本书，刚买的，正在看，还没看完。作为新年礼物送给你。交朋友！司机小哥哥（小姐姐），收下我的贿赂吧！

