我想找咱华工北校北区的女孩子！
我真想体验咱们华园恋情啊～
不看脸的好不好&hellip;&hellip;

求！！除周一周三外任意通识课！！！
第一轮选中了环境科学与工程导论，另一个被踢了。第二轮跟学姐约好退给我一门科技的课，我也成功接手了。可是万万没想到今天看课表发现第一轮自己得到的环境科学与工程导论被踢了（从来没听过第二轮也会踢人呀好气）。
特别担心没课上，心真的很塞&hellip;&hellip;

研三毕业生或以上
希望能找个个子175，戴眼镜，逗比，性格好，皮肤很白，会打篮球，不抽烟喝酒，不闷骚型，老实，成熟，稳重，开得起玩笑！
帅哥勿扰！毕竟hold不住！花心的，勿扰！没时间和你浪费青春撒&hellip;&hellip;
很认真的想找个男票，希望对方也是认真的，小灯神上找到我喜欢的男生，好好谈一场恋爱&hellip;&hellip;

【宝宝羊城通丢了】
应该就是4月23日也就是今天下午4点多的时候，可能是在从多品美到北二这段路上&hellip;&hellip;卡有卡贴，正反两面图片如下图&hellip;&hellip;
有见到的宝宝烦请联系：18819421339（661339）这个号码吧！【比哈特.jpg】

今天早上在东区东湖的小路上捡到一张岭南通，希望失主加微信来认领。因为没有名字，所以希望加好友时便备注岭南通卡号，或者明确说出余额，或者你的充值时间、消费记录及金额。如果连失主自己什么都不记得，那我也没办法啦╮(︶﹏︶)╭等到5.10吧，再没人来认领，我就自己用啦。加好友时，请按照下面验证格式加:
&quot;岭南通:xxxxxx(卡号)&quot;或者&quot;岭南通:余额xx.x&quot;或者&quot;岭南通:x月x日充值x元&quot;
不按照格式或者说错了的话，好友不一定通过哦。

